class Solution {
    public int maximumLength(String s) {
        int result = -1;
        for (char ch = 'a'; ch <= 'z'; ch++) {
            int first = -1, second = -1, third = -1;
            for (int i = 0; i < s.length(); i++) {
                if (s.charAt(i) == ch) {
                    if (first == -1) first = i;
                    else if (second == -1) second = i;
                    else third = i;
                    if (first != -1 && second != -1 && third != -1) {
                        result = Math.max(result, second - first);
                        first = second;
                        second = third;
                        third = -1;
                    }
                }
            }
        }
        return result;
    }
}
